import React from 'react'
import { Row, Col } from 'react-bootstrap'
import { Link } from 'react-router-dom'


export default function Job({ data }) {
    return (
        <Row className="mx-0 mt-3 p-3" >
            <Col style={{
            color: "#fff",
            backgroundColor: "#5865F2",
            border: "1px solid gray",
            borderRadius: "10px"}} xs={3}><Link to={`/${data.company_name}`}>{data.company_name}</Link></Col>
            <Col style={{
            color: "#fff",
            backgroundColor: "#5865F2",
            border: "1px solid gray",
            borderRadius: "10px"}} xs={9}><Link to={{ pathname: data.url }} target='_blank'>{data.title}</Link></Col>
        </Row>
    )
}
